import React from "react";
import { Link } from "react-router-dom";
import Aos from "aos";
import 'aos/dist/aos.css';
import "../styles/App.css";
import "../styles/Buttons.css";
import "../styles/Home.css";

function Home() {
  React.useEffect (() => {
    Aos.init({ duration: 1000 });
  }, []);

  return (
    <div className="container">
      <div className="home-grid">
        <div data-aos='zoom-in'>
          <h1 className="">Welcome to my Portfolio</h1>
          <p className="">
            Lorem ipsum dolor sit amet, consectetur adipiscing elit. Nulla vitae
            ipsum et neque egestas feugiat.
          </p>
          <div>
          <button id="component-1" class="button button--1">
            <Link to="/portfolio"> {/*data-aos="fade" data-aos-offset="100"*/}
              <p className="button">Check out my portfolio</p>
            </Link>
						<span class="button__container">
							<span class="circle top-left" style="transform: matrix(0.7071, -0.7071, 0.7071, 0.7071, 0, 0);"></span>
							<span class="circle top-left" style="transform: matrix(0.7071, -0.7071, 0.7071, 0.7071, 0, 0);"></span>
							<span class="circle top-left" style="transform: matrix(0.7071, -0.7071, 0.7071, 0.7071, 0, 0);"></span>
							<span class="button__bg"></span>
							<span class="circle bottom-right" style="transform: matrix(0.7071, -0.7071, 0.7071, 0.7071, 0, 0);"></span>
							<span class="circle bottom-right" style="transform: matrix(0.7071, -0.7071, 0.7071, 0.7071, 0, 0);"></span>
							<span class="circle bottom-right" style="transform: matrix(0.7071, -0.7071, 0.7071, 0.7071, 0, 0);"></span>
						</span>
					</button>

          </div>
        </div>
      </div>
    </div>
  );
}

export default Home;
